import React from 'react'

function Jobtitle() {
  return (
    <div>
      <Grid container width={1200} 
          style={{ 
          display: 'flex', 
          alignItems: 'center',
          margin: '0 auto'
          }}
        >
          {jobs.slice(0, 5).map((job) => (
            <Grid item xs={2} sm={4} md={4} key={job.id}>
              <Box job={job}/>
            </Grid>
          ))}
        </Grid>
    </div>
  )
}

export default Jobtitle
